import React, { Component } from "react";
import Layout from "../../../components/Layout";
import { Link } from "../../../routes";
import { Button } from "semantic-ui-react";

class RequestNew extends Component {
  render() {
    return (
      <Layout>
        <h3>Requests</h3>
      </Layout>
    );
  }
}

export default RequestNew;
